/****** Object:  UserDefinedFunction [dbo].[Fn_GetMyJobsCurrentButtion]    Script Date: 27-02-2026 23:46:50 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO



CREATE FUNCTION [dbo].[Fn_GetMyJobsCurrentButtion] 
(
	@CurrentState VARCHAR(1500),
	@QuotationStatus VARCHAR(1500)
)
RETURNS VARCHAR(1500)
AS
BEGIN

	DECLARE @CurrentButtionName VARCHAR(1500)=''


	--if(@CurrentState='ASSIGNED' OR @CurrentState='IN PROGRESS' OR @CurrentState='PAYMENT PENDING')
	IF(@QuotationStatus IS NULL AND @CurrentState='ASSIGNED')
	BEGIN
	SET @CurrentButtionName='QUOTATION'
	END
	ELSE IF(@QuotationStatus='APPROVED' AND @CurrentState='ASSIGNED')
	BEGIN
	SET @CurrentButtionName='START'
	END
	ELSE IF(@QuotationStatus='APPROVED' AND @CurrentState='IN PROGRESS')
	BEGIN
	SET @CurrentButtionName='IMAGE'
	END
	ELSE IF(@QuotationStatus='APPROVED' AND @CurrentState='PAYMENT PENDING')
	BEGIN
	SET @CurrentButtionName='PAYMENT'
	END


	
	-- Return the result of the function
	RETURN @CurrentButtionName

END
GO
