CREATE PROC [dbo].[Sp_AddOrRemoveQuotationItems]
(
@QuotationId INT,
@QuotationItemId INT,
@ItemId INT,
@Quantity decimal,
@Flag CHAR
)
AS BEGIN
IF(@Flag='D')
BEGIN
delete from QuotationItems where QuotationItemId=@QuotationItemId
END
ELSE IF(@Flag='U')
BEGIN
UPDATE QuotationItems set Quantity=@Quantity ,TotalPrice=(@Quantity*UnitPrice)
where QuotationItemId=@QuotationItemId
END
ELSE IF(@Flag='I')
BEGIN
INSERT INTO QuotationItems (QuotationId,ItemId,ItemDescription,HSNCode,Quantity,UOM,UnitPrice,TotalPrice)
SELECT @QuotationId,ItemId,ItemName,HSNCode,@Quantity,UOM,DefaultPrice,(DefaultPrice*@Quantity)from  Items 
where ItemId=@ItemId

END


END
GO
/****** Object:  StoredProcedure [dbo].[Sp_CreateQuotation]    Script Date: 27-02-2026 23:47:16 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE PROC [dbo].[Sp_CreateQuotation]
(
@JobId INT,
@SubTotal decimal,
@DiscountValue  decimal,
@CGST decimal,
@SGST decimal,
@TotalAmount decimal,
@Status VARCHAR(100),
@CreatedBy int,
@Items VARCHAR(max)
)
AS BEGIN


insert into Quotations 
(JobId,QuotationNumber,SubTotal,DiscountType,DiscountValue,CGST,SGST,TotalAmount,Status,ApprovedOn,CreatedAt,CreatedBy)
values (@JobId,'QT-2026-0001',@SubTotal,'Flat',@DiscountValue,@CGST,@SGST,@TotalAmount,@Status,
CASE WHEN @Status='APPROVED' THEN GETDATE() ELSE NULL END,GETDATE(),@CreatedBy)

DECLARE @QuotationId INT;

SET @QuotationId = SCOPE_IDENTITY();

--DECLARE @data NVARCHAR(MAX) = '1:2,2:2,3:3';
CREATE TABLE #TempData
(
    ItemId INT,
    Quantity INT
);

INSERT INTO #TempData (ItemId, Quantity)
SELECT 
    CAST(LEFT(value, CHARINDEX(':', value) - 1) AS INT),
    CAST(RIGHT(value, LEN(value) - CHARINDEX(':', value)) AS INT)
FROM STRING_SPLIT(@Items, ',');





INSERT INTO QuotationItems (QuotationId,ItemId,ItemDescription,HSNCode,Quantity,UOM,UnitPrice,TotalPrice)
SELECT @QuotationId,a.ItemId,ItemName,HSNCode,Quantity,UOM,DefaultPrice,(DefaultPrice*Quantity) FROM #TempData as a inner join Items as b on a.ItemId=b.ItemId


IF(@Status='REJECTED')
BEGIN

UPDATE JOBS SET JobStatus='REJECTED' where JobId=@JobId
END

END
GO
/****** Object:  StoredProcedure [dbo].[Sp_GetMyJobs]    Script Date: 27-02-2026 23:47:16 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
--EXEC Sp_GetMyJobs 1

CREATE proc [dbo].[Sp_GetMyJobs]
(
@UserID INT
)
AS BEGIn 
SELECT a.JobId,[JobNumber],CustomerName,MobileNo,d.ServiceName,a.ScheduledOn,
e.AddressLine1+','+e.Area+','+e.City+','+e.[State]+','+e.Pincode as [Address],e.[Latitude],e.[Longitude],a.JobStatus,
dbo.Fn_GetMyJobsCurrentButtion(a.JobStatus,f.Status) as CurrentButtion,StartTime,a.JobStatus,f.Status,f.QuotationId,f.TotalAmount,a.EndTime
  FROM [Jobs] as a inner join [Customers] as b on a.[CustomerId]=b.[CustomerId]
  inner join [Leads] as c on c.LeadId=a.LeadId
  inner join [ServiceTypes] as d on d.ServiceTypeId=c.ServiceTypeId
  inner join CustomerAddresses as e on e.CustomerAddressId=c.CustomerAddressId
  LEFT JOIN [dbo].[Quotations] as f on f.JobId=a.JobId

END
GO
/****** Object:  StoredProcedure [dbo].[Sp_UpdateStatus]    Script Date: 27-02-2026 23:47:16 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[Sp_UpdateStatus]
(
@UserID INT,
@JobId INT,
@Status VARCHAR(1500),
@Latitude DECIMAL,
@Longitude DECIMAL
)
AS BEGIN

if(@Status='IN PROGRESS')
BEGIN
UPDATE JOBs SET JobStatus=@Status,StartTime=getdate(),StartLatitude=@Latitude,StartLongitude=@Longitude  WHERE JobId=@JobId
END 
ELSE if(@Status='PAYMENT PENDING')
BEGIN
UPDATE JOBs SET JobStatus='PAYMENT PENDING',EndTime=getdate(),EndLatitude=@Latitude,EndLongitude=@Longitude  WHERE JobId=@JobId
END 

END
GO
